import java.util.HashMap;
import java.util.Map;
import java.util.Set;

public class Solution242 {
    public boolean isAnagram(String s, String t) {
        Map<Object,Integer> map1=new HashMap(),map2=new HashMap<>();
        for(char tc:s.toCharArray()){
            map1.put(tc,map1.getOrDefault(tc,0)+1);
        }
        for(char tc:t.toCharArray()){
            map2.put(tc,map2.getOrDefault(tc,0)+1);
        }
        Set keys1=map2.keySet(),keys2=map1.keySet();
        System.out.println("1");
        if(keys1.size()!=keys2.size())return false;
        System.out.println("2");
        for(Object key:keys1){
            int num1=map1.getOrDefault(key,0);
            int num2=map2.getOrDefault(key,0);
            if(num1!=num2){
                System.out.println(key);
                return false;
            }
        }
        return  true;
    }
    public static void main(String[] args) {
        String s="",
        t="",
        a="abcdd",b="dabcd";

        System.out.println(new Solution242().isAnagram(s,t));

    }
}
